import { createSlice } from '@reduxjs/toolkit'
import { User } from '../Interfaces/TodoInterfaces'

const initialUser: User = {
    id: null,
    isDeleted: false,
    todos: [],
}

export const userSlice = createSlice({
    name: 'user',
    initialState: initialUser,
    reducers: {
        login: (state, action) => {},
        logout: () => { return initialUser },
    }
});
